pragma solidity 0.8.21;

contract ZTMExercise_1 {
    function sendMeBackLess(uint256 number) external payable {
        console.log(number);
        require(number != 9, "We don't like 9.");

        if (number % 2 == 0) {
            console.log("in if");
             console.log(msg.value/2);
            payable(msg.sender).transfer(msg.value / 2);
        } else {
              console.log("in else");
                console.log(msg.value);
            payable(msg.sender).transfer(msg.value);
        }
    }
}

library console {
    address constant CONSOLE_ADDRESS =
